(function(){
    var ord = stm_document;
    regnumbers.registerProject(ord, "ORD_PROJECT_NUMBER");
    ord.save();
    if (ord.assocs["lecm-ord:accepted-assoc"] != null && ord.assocs["lecm-ord:accepted-assoc"].length > 0) {
		var parentDocument = ord.assocs["lecm-ord:accepted-assoc"][0];
        notificationText = substitude.formatNodeTitle(parentDocument.nodeRef.toString(), "По документу " + documentScript.wrapperDocumentLink(parentDocument , "№ {~REGNUM} от {~REGDATE}"));
        notificationText += substitude.formatNodeTitle(ord.nodeRef.toString(), " создан проект " + documentScript.wrapperDocumentLink(ord , "№ {~REGNUM}"));
      	businessJournal.log(parentDocument.nodeRef.toString(), "REGISTRATION", notificationText, []);
    }
})();

